import React from 'react'
import './Home.css'
export default function Home() {
  return (
      <>
    <div className='title'>
        <h1>Hello there! Welcome to my portfolio</h1>
        <p>My name is Lautaro Coria, a videogame and front-end independent developer</p>
    </div>
    
    </>
  )
}
